import React, { Component } from "react";
import MainHeader from "./MainHeader";
import Dashboard from "./Dashboard";

export class MainPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLogedIn: false,
      logedInUsername: "",
    };
  }

  parentFunction = (data) => {
    console.log(data);
    this.setState({ isLogedIn: data.isLoggedIn });
    /*
    this.setState({
      isLogedIn: data.isLoggedIn,
      logedInUsername: data.username,
    });
    */
  };

  render() {
    return (
      <div>
        <div>
          <MainHeader
            callFromParent={this.parentFunction.bind(this)}
          ></MainHeader>
        </div>
        <div>
          <Dashboard userLogedIn={this.state.isLogedIn}></Dashboard>
        </div>
      </div>
    );
  }
}

export default MainPage;
